import { Link } from "react-router-dom";
import logo from "../images/logo.svg";

function Header({mail, loggedIn}, props) {
  function handleLoginOpen() {
    console.log(props.isOpen);
  }

  return (
    <header className="header">
      <img className="header__logo" src={logo} alt="лого" />
      <div className="header__info">
        <p className="header__email">{`${loggedIn ? `${mail}` : '' }`}</p>
        <Route path="/sign-in">
          <Link to='sign-up' className='header__link'>Регистрация</Link>
        </Route>
        <Route path="/sign-up">
          <Link to='sign-in' className='header__link'>Войти</Link>
        </Route>
        {/* {loggedIn ? <Link to="/signin" className="header__button" onClick={handleLoginOpen}>Выйти</Link> : <Link to="/signin" className="header__button">Войти</Link>} */}
      </div>
    </header>
  );
}

export default Header;
